import { View, Text, TouchableOpacity } from 'react-native'
import React from 'react'

export default function ViewCart() {
    return (
        <View style={{
            flex: 1,
            justifyContent: 'center',
            alignItems: "center",
            flexDirection: 'row',
            bottom: '5%',
            zIndex: 999,
            position: 'relative',
        }}
        >
            <View style={{
                justifyContent: 'center',
                width: "100%",
                flexDirection: 'row',
            }}
            >
                <TouchableOpacity style={{
                    marginTop: 20,
                    backgroundColor: 'black',
                    alignItems: "center",
                    padding: 13,
                    borderRadius: 30,
                    width: 300,
                    position: 'relative',
                }}
                >
                    <Text style={{ color: 'white', fontSize: 20 }}>View Cart ðŸ›’</Text>
                </TouchableOpacity>
            </View>
        </View>
    )
}
